goog.math.Matrix.prototype.isInBounds_=function(a,b){return a>=0&&a<this.size_.height&&b>=0&&b<this.size_.width};goog.math.Matrix.prototype.matrixMultiply_=function(a){var b=new goog.math.Matrix(this.size_.height,a.getSize().width);goog.math.Matrix.forEach(b,function(c,d,e){for(var f=c=0;f<this.size_.width;f++)c+=this.getValueAt(d,f)*a.getValueAt(f,e);b.setValueAt(d,e,c)},this);return b};goog.math.Matrix.prototype.scalarMultiply_=function(a){return goog.math.Matrix.map(this,function(b){return b*a})};
goog.math.Matrix.prototype.swapRows_=function(a,b){var c=this.array_[a];this.array_[a]=this.array_[b];this.array_[b]=c};var matrix={};goog.exportSymbol("goog.math.Matrix",goog.math.Matrix);
